import { Grid } from "@mui/material";
// import GridLayout from "react-grid-layout";

function App(params) {
	return (
		<Grid container spacing={2}>
			<Grid item xs={12} className="border">
				<div>xs=8</div>
			</Grid>
			<Grid item xs={4}>
				<div>xs=4</div>
			</Grid>
			<Grid item xs={4}>
				<div>xs=4</div>
			</Grid>
			<Grid item xs={8}>
				<div>xs=8</div>
			</Grid>
		</Grid>
	);
}
export default App;
